import { useEffect, useState } from "react";
import React from "react";

function App() {
   const mockTodos = [
      { id: "1", userId: "1", title: "Needed text", completed: "true" },
      { id: "2", userId: "1", title: "Needed ", completed: "true" },
      { id: "2", userId: "1", title: "Text ", completed: "true" },
   ];
   return (
      <div>
         {mockTodos.map((todo) => {
            <h1>{todo.id}</h1>;
            <p>{todo.title}</p>;
         })}
      </div>
   );
}

export default App;
